(()=>{"use strict";const n='\n<div class="spinner-border" role="status">\n<span class="visually-hidden">Loading...</span>\n</div>',t=document.querySelector(".classList"),e=[],r=document.querySelector(".quizList"),o=[];t.innerHTML=n,fetch("./class.json").then((function(n){n.json().then((function(n){e.push(n),function(n){const e=n.length;t.innerHTML=null;for(let r=0;r<e;r++){const e=n[r].title,o=n[r].docUrl,c=n[r].links,s=n[r].gitUrl,d=n[r].date,l=function(n){let t="";for(let e=0;e<n.length;e++)t+=`\n        <a \n        href="${n}"\n        class="badge bg-secondary"\n        >${e+1}</a\n        >\n        `;return t};t.innerHTML+=`\n    <tr>\n    <th scope="row">${r+1}</th>\n    <td>${e}</td>\n    <td>\n    <a href="${o}" class="badge bg-secondary"\n    >문서</a\n    >\n    </td>\n    <td>\n    ${l(c)}\n    </td>\n    <td>${d}</td>\n    <td>\n    <a\n    href="${s}"\n    >git</a\n    >\n    </td>\n    </tr>`}}(n)}))})).catch((function(n){console.log("Fetch Error :-S",n)})),r.innerHTML=n,fetch("./quiz.json").then((function(n){n.json().then((function(n){o.push(n),function(n){const t=n.length;r.innerHTML=null;for(let e=0;e<t;e++){const t=n[e].title,o=n[e].docUrl,c=n[e].previewUrl,s=n[e].gitUrl;r.innerHTML+=`\n    <tr>\n      <td>${t}</td>\n      <td>\n        <a\n          class="badge bg-secondary"\n          href="${o}"\n          >문서</a\n        >\n      </td>\n      <td><a href="${c}">보기</a></td>\n      <td><a href="${s}">git</a></td>\n    </tr>`}}(n)}))})).catch((function(n){console.log("Fetch Error :-S",n)}))})();